import React from 'react'
import styled from "styled-components"


const Container = styled.div`
    width: 100%;
    height: 740px;
    background-color: #fff;
    font-family: 'Lato', sans-serif;
    color: #111439;
    padding-top: 20px;
`

const ContentContainer = styled.div`
    width: 1100px;
    height: 600px;
    padding-top: 30px;
    margin-left: 50%;
    transform: translateX(-50%);
    display: flex;
`

const TextContainer = styled.div`
    margin-top: 40px;
    margin-left: 50px;
    // background-color: #f00;
    width: 50%;
`

const AboutHeader = styled.h1`
    font-size: 32px;
    font-weight: 800;
`


export default function AboutSection () {
    return (
        <Container>
            <ContentContainer>
            <TextContainer>
            <AboutHeader>
                    A Little About Me ✌️
                </AboutHeader>
            </TextContainer>
            </ContentContainer>
        </Container>
    )
}
